window.bookSummaryJSON = "<p><b>New achievement! Total, utter failure.</b></p> <p><b>You failed a quest less than five minutes after you received it. Now </b><b><i>thatâ€™s</i></b><b> talent.</b></p> <p>A floating fortress occupied by warrior gnomes. A castle made of sand. A derelict submarine guarded by malfunctioning machines. A haunted crypt surrounded by lethal traps. </p> <p>It was supposed to be easy. One bubble. Four castles. Fifteen days. Capture each one, and the stairwell is unlocked.</p> <p>Here's the thing. It's never easy. Carl and his team can't go it alone. Not this time. They must rely on the help of the low-level, I-can't-believe-these-idiots-are-still-alive crawlers trapped in the bubble with them. But can they be trusted? </p> <p>Welcome, Crawler. Welcome to the fifth floor of the dungeon.</p>"; 
